import{_ as a,c as t,o as e,a as l}from"./app.9a9f499d.js";const r="/st0059-01.png",i="/st0059-02.png",s="/st0059-03.png",d="/st0059-04.png",G=JSON.parse('{"title":"凹语言获GitCode年度开源人物","description":"","frontmatter":{},"headers":[{"level":2,"title":"1. 丁尔男获GitCode年度开源人物","slug":"_1-丁尔男获gitcode年度开源人物","link":"#_1-丁尔男获gitcode年度开源人物","children":[]},{"level":2,"title":"2. 凹语言代表PLOC社区接受颁奖","slug":"_2-凹语言代表ploc社区接受颁奖","link":"#_2-凹语言代表ploc社区接受颁奖","children":[]},{"level":2,"title":"3. PLOC社区多个项目入选G-Star Landscape","slug":"_3-ploc社区多个项目入选g-star-landscape","link":"#_3-ploc社区多个项目入选g-star-landscape","children":[]},{"level":2,"title":"4. 感谢","slug":"_4-感谢","link":"#_4-感谢","children":[]}],"relativePath":"smalltalk/st0059.md"}'),c={name:"smalltalk/st0059.md"},o=l('<h1 id="凹语言获gitcode年度开源人物" tabindex="-1">凹语言获GitCode年度开源人物 <a class="header-anchor" href="#凹语言获gitcode年度开源人物" aria-hidden="true">#</a></h1><ul><li>时间：2024-11-01</li><li>撰稿：凹语言开发组</li><li>转载请注明原文链接：<a href="https://wa-lang.org/smalltalk/st0059.html" target="_blank" rel="noreferrer">https://wa-lang.org/smalltalk/st0059.html</a></li></ul><hr><p>10月25日，“2024 GitCode开源共创大会暨 G-Star 嘉年华”在世界计算·长沙智谷盛大开幕；大会旨在汇聚全球开发者的智慧，探讨开源未来的发展走向，促进开源生态的良性发展。凹语言开发组应GitCode大会组办法邀请赴长沙参会。</p><p><img src="'+r+'" alt=""></p><h2 id="_1-丁尔男获gitcode年度开源人物" tabindex="-1">1. 丁尔男获GitCode年度开源人物 <a class="header-anchor" href="#_1-丁尔男获gitcode年度开源人物" aria-hidden="true">#</a></h2><p>凹语言项目联合发起人丁尔男，凭借在凹语言项目的杰出贡献，荣获了“GitCode年度开源人物”奖。</p><p><img src="'+i+'" alt=""></p><h2 id="_2-凹语言代表ploc社区接受颁奖" tabindex="-1">2. 凹语言代表PLOC社区接受颁奖 <a class="header-anchor" href="#_2-凹语言代表ploc社区接受颁奖" aria-hidden="true">#</a></h2><p>凹语言是编程语言开放社区（PLOC）社区的创始单位。丁尔男作为社区秘书接受“GitCode年度十大开源社区”荣誉颁奖。</p><p><img src="'+s+'" alt=""></p><h2 id="_3-ploc社区多个项目入选g-star-landscape" tabindex="-1">3. PLOC社区多个项目入选G-Star Landscape <a class="header-anchor" href="#_3-ploc社区多个项目入选g-star-landscape" aria-hidden="true">#</a></h2><p>本次嘉年华GitCode首次发布 G-Star Landscape。在来自PLOC社区的凹语言、狮偶、洛书等多个项目入选。</p><p><img src="'+d+'" alt=""></p><h2 id="_4-感谢" tabindex="-1">4. 感谢 <a class="header-anchor" href="#_4-感谢" aria-hidden="true">#</a></h2><p>凹语言和PLOC社区获得这些荣誉，是大会组办方对这个项目方向的认可和鼓励。感谢大家的支持！</p>',16),n=[o];function p(_,h,g,m,C,u){return e(),t("div",null,n)}const k=a(c,[["render",p]]);export{G as __pageData,k as default};
